import { useEffect, useState } from 'react';

function Fuse() {
  const [pokeIds, setPokeIds] = useState([]);

  // symulacja pobrania ID-ków Pokémonów
  useEffect(() => {
    // przykładowe ID Pokémonów – możesz je pobierać z API
    const ids = [1, 4, 7, 25, 150]; // Bulbasaur, Charmander, Squirtle, Pikachu, Mewtwo
    setPokeIds(ids);
  }, []);

  return (
    <div>
        <div>
            <select>
            {pokeIds.map(id => (
            <option key={id} value={id}>
                Pokémon {id}
            </option>
            ))}
        </select>
        </div>
      
      <select>
        {pokeIds.map(id => (
          <option key={id} value={id}>
            Pokémon {id}
          </option>
        ))}
      </select>
    </div>
  );
}

export default Fuse;
